function updateMaxTransactionAmount(uint256 newMaxTxAmount) public {
    require(newMaxTxAmount > 0, "Invalid transaction amount");
    require(msg.sender == owner, "Ownable: caller is not the owner");
    maxTxAmount = newMaxTxAmount;
}

